import React from "react";
import {Box, Typography, styled} from "@mui/material"
import Background from "./../Images/HeroBackground.jpg";

const StyledBox = styled(Box)({
    background: "#BFD200",
    height: "60px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
});

export default function Hero() {
    return (
        <Box sx={{backgroundImage:`url(${Background})`, height:"100%"}}>
            <StyledBox>
                <Typography variant="h4">
                    DEIN DIGITALER 
                </Typography>
                <Typography variant="h4" sx={{fontWeight:"bold", p:"5px"}}>
                    CO-TRAINER
                </Typography>
            </StyledBox>
        </Box>
    )
}
